import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import './App.css';
import ContactSection from './Components/contact';
import GroomingService from './Components/GroomingService';
import Header from './Components/Header';
import Hero from './Components/Hero';
import Navbar from './Components/Navbar';
import ProductCarousel from './Components/Ourbestseller';
import CategorySection from './Components/OurCategory';
import StorePage from './Components/StorePage'; // ✅ Corrected path
import { ContactPage } from "./Components/ContactPage";
import ProductDetails from "./Components/ProductDetails";

function App() {
  return (
    <Router>
      <Header />
      <Navbar />

      <Hero />
    <ProductCarousel />
    <CategorySection />
    <GroomingService />
      <Routes>
        <Route path="/" element={
          <>
            <Hero />
            <ProductCarousel />
            <CategorySection />
            <GroomingService />
          </>
        } />
        <Route path="/store" element={<StorePage />} />
        <Route path="/contact" element={<ContactPage />} />
        <Route path="/productdetails" element={<ProductDetails />} />
      </Routes>
    </Router>

  );
}

export default App;
